    					<div class="jtitle">It Opening and Vacancy</div>
    					<div class="jtxt"></div>
    					<div><p>The information technology industry in India has a multitude of companies that employ thousands of job seekers in the sector. This has created high demand for IT jobs in the country.</p><p>IT is the name of the sector that powers the technology to enable and power the storage and flow of information in organizations through computer software. The minimum qualifications required to apply for a job in IT is a bachelor?s degree in Information Technology or B. Tech (IT).</p><p>There are many vacancies in IT for roles like computer support specialists, computer programmers, computer system analysts, network administrators, database administrators, computer &amp; information systems managers and many more. IT technicians offer support in terms of computer programming, technical support, systems analysis etc.</p><p>There are many IT job opportunities available for job seekers in the cities of Bangalore, Hyderabad, Chennai, Mumbai, NCR, Pune and Kolkata. Some major companies that offer careers in information technology are Tata Consultancy Services, Infosys, Wipro, HCL, The Mahindra, Oracle and Larson &amp; Toubro Infotech among others.</p><p>Monster India connects job seekers with relevant job openings to help build meaningful careers. If you are looking for a job opportunities in information technology, upload your updated resume to www.monsterindia.com and never miss a job alert for IT jobs.</p></div>
